import "./libcont.css";


function news() {

  return (
    <>
        <div className="foodcontainer">
                <div className="left-side">
                <iframe
                  src={"/news/index.html"}
                  height={"100%"}
                  width={"100%"}
                  name="iframe-music"
                  style={{ width: '100%', border: '0px', height: '100%' }}
                />
                </div>
                <div className="right-side">
                <iframe
                  src={"/apple_watch/index.html"}
